function yoy_growth(c,a){var d=new Date(a.date);d.setDate(d.getDate()-365);var b=c.sort(function(f,e){var h=Math.abs(d-new Date(f.date));var g=Math.abs(d-new Date(e.date));return h-g})[0];if(b.perc==0){return 0}return(a.perc-b.perc)/b.perc}function mom_growth(b,a){var c=new Date(a.date);c.setDate(c.getDate()-31);var d=b.sort(function(f,e){var h=Math.abs(c-new Date(f.date));var g=Math.abs(c-new Date(e.date));return h-g})[0];if(d.perc==0){return 0}return(a.perc-d.perc)/d.perc};